import  './GeradorNumeros.css'

function GerarNumeros(){
   const NumerosLotoFacil = gerador();
    return(
      <section>
         <p>${NumerosLotoFacil}</p>
      </section>
    )
}
export default GerarNumeros;

const gerador=()=> {
    const Numeros = [];

    for (let i = 0; i < 25; i++)
        Numeros[i] = i + 1;

    let remover = 10;

    while (remover > 0) {
        const n = Math.random() * 25;
        if (Numeros[n] > 0) {
            remover--;
            Numeros[n] = 0;
        }
    }

}
